INSERT INTO `help` VALUES (1,2,3,'How to Place an Order',_binary '<h1 style=\"border: 0px solid rgb(217, 217, 227); --tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-gradient-from-position: ; --tw-gradient-via-position: ; --tw-gradient-to-position: ; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgba(69,89,164,.5); --tw-ring-offset-shadow: 0 0 transparent; --tw-ring-shadow: 0 0 transparent; --tw-shadow: 0 0 transparent; --tw-shadow-colored: 0 0 transparent; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ; margin-bottom: 0px;\"><div style=\"text-align: justify;\"><span style=\"color: inherit; font-style: italic; font-weight: bold; font-size: small;\">To place an order on our website or app, please follow these steps:</span><br></div><span style=\"font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\"><div style=\"font-size: medium; text-align: justify;\"><span style=\"color: inherit;\">1. Visit our website or open the app.</span></div><div style=\"font-size: medium; text-align: justify;\"><span style=\"color: inherit;\">2. Sign up using either your country number or a UK number.</span></div><div style=\"font-size: medium; text-align: justify;\"><span style=\"color: inherit;\">3. Choose your country code from the dropdown section.</span></div><div style=\"font-size: medium; text-align: justify;\"><span style=\"color: inherit;\">4. After signing up, enter your UK postcode.</span></div><div style=\"font-size: medium; text-align: justify;\"><span style=\"color: inherit;\">5. Select your preference for the delivery method: \"Meet at Vehicle\" or \"Meet at Door.\"</span></div><div style=\"font-size: medium; text-align: justify;\"><span style=\"color: inherit;\">6. If you choose \"Meet at Door,\" please provide your flat number and house name.</span></div><div style=\"font-size: medium; text-align: justify;\"><span style=\"color: inherit;\">7. Browse and select your favourite restaurant from the available options.</span></div><div style=\"font-size: medium; text-align: justify;\"><span style=\"color: inherit;\">8. Add your desired items to your cart.</span></div><div style=\"font-size: medium; text-align: justify;\"><span style=\"color: inherit;\">9. Proceed to the checkout.</span></div><div style=\"font-size: medium; text-align: justify;\"><span style=\"color: inherit;\">10. Make the payment for your order.</span></div><div style=\"font-size: medium; text-align: justify;\"><span style=\"color: inherit;\">11. Our delivery personnel will bring your order to your door.</span></div><div style=\"font-size: medium; text-align: justify;\"><span style=\"color: inherit;\">12. You can track the delivery status through our app.</span></div><div style=\"font-size: medium; text-align: justify;\">Enjoy your meal !!</div><div style=\"font-size: medium; text-align: justify;\">Click here to download android app-&nbsp;<a href=\"https://play.google.com/store/apps/details?id=com.thirtymins.user\" target=\"_blank\">Download Now</a></div><div style=\"font-size: medium; text-align: justify;\">Click Here to Download iPhone app&nbsp;<a href=\"https://apps.apple.com/gb/app/thirtymins-food-delivery-uk/id6464297418\" target=\"_blank\">Download Now </a></div></span></h1><ul style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: \" open=\"\" sans\",=\"\" arial,=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" text-align:=\"\" justify;=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\"><li></li><li></li><li></li><li></li><li></li></ul>','yes','Active','2018-09-17 16:53:57','2023-10-25 17:30:58'),(2,2,4,'Suspendisse faucibus elit eu sem porttitor luctus.',_binary '<li>Suspendisse faucibus elit eu sem porttitor luctus.</li>','yes','Active','2018-09-17 17:28:00','2018-09-17 17:28:00'),(3,3,5,'Mauris at diam vel justo pretium elementum.',_binary '<li>Mauris at diam vel justo pretium elementum.</li>','yes','Active','2018-09-17 17:28:23','2018-09-17 17:28:23'),(4,4,6,'Curabitur quis est sagittis, pharetra massa et, pulvinar enim.',_binary '<li>Curabitur quis est sagittis, pharetra massa et, pulvinar enim.</li>','yes','Active','2018-09-17 17:28:41','2018-09-17 17:28:41'),(5,5,7,'Mauris sed leo posuere, dapibus risus in, varius ante.',_binary '<li>Mauris sed leo posuere, dapibus risus in, varius ante.</li>','yes','Active','2018-09-17 17:28:57','2018-09-17 17:28:57'),(6,6,8,'Nam sit amet ligula quis dolor dignissim ultricies id eget nisi.',_binary '<li>Nam sit amet ligula quis dolor dignissim ultricies id eget nisi.</li>','yes','Active','2018-09-17 17:29:12','2018-09-17 17:29:12'),(7,6,9,'Sed dapibus tortor eget metus imperdiet, eget imperdiet ipsum volutpat.',_binary '<li>Sed dapibus tortor eget metus imperdiet, eget imperdiet ipsum volutpat.</li>','yes','Active','2018-09-17 17:29:27','2018-09-17 17:29:27'),(8,7,10,'Aliquam imperdiet sem et mollis rhoncus.',_binary '<li>Aliquam imperdiet sem et mollis rhoncus.</li>','yes','Active','2018-09-17 17:29:47','2018-09-17 17:29:47'),(9,7,11,'Nunc a ligula ac turpis venenatis tincidunt ut ut quam.',_binary '<li>Nunc a ligula ac turpis venenatis tincidunt ut ut quam.</li>','yes','Active','2018-09-17 17:30:35','2018-09-17 17:30:35'),(10,8,12,'Nunc a ligula ac turpis venenatis tincidunt ut ut quam.',_binary '<li>Nunc a ligula ac turpis venenatis tincidunt ut ut qu