INSERT INTO `metas` VALUES (1,'/','Home Page','Home Page','Thirtymins Limited is a rapidly growing online food delivery service committed to providing customers with fast and efficient delivery of their favorite cuisines.'),(2,'signin_company','Sign In Company','Welcome back once again! We\'re thrilled to see you return to sign in again. It\'s always a pleasure to have loyal customers like you. As you know, we\'re here to cater to your needs and ensure that your experience is nothing short of fantastic.','Thirtymins Sign IN'),(3,'signup_company','Sign Up Company','Welcome to the ThirtyMins Food Delivery Sign-Up Section!\r\n\r\nWe\'re thrilled that you\'re considering joining our food-loving community. Signing up is quick and easy, and it opens the door to a world of delightful culinary experiences','Thirtymins Sign Up'),(4,'contact_us','Contact Us','We\'re here to assist you! If you have any questions, concerns, or need support, don\'t hesitate to reach out to us','Thirtymins - Contact Us'),(5,'forgot_password_company','Forgot Password','Oh no! It happens to the best of us. No worries, we\'ve got you covered.',''),(6,'company/reset_password','Reset Password','Reset Password',''),(7,'app/provider','Rider  App','Rider  App','\"ThirtyMins Rider: The Swift Food Delivery App for Drivers\"'),(8,'app/rider','Rider App','Rider App','\"ThirtyMins Rider: The Swift Food Delivery App for Drivers\"'),(9,'store/signup','Store Signup','Store Signup',''),(10,'store/login','Store Login','Welcome to the ThirtyMins Store Login!\r\n\r\nAs a store partner with ThirtyMins, this login portal allows you to manage your restaurant\'s presence on our platform, ensuring a smooth and delightful experience for our mutual customers.',''),(11,'store/password','Store Password','Store Password',''),(12,'store/forget_password','Store Forget Password','Store Forget Password',''),(13,'store/mail_confirm','Store Mail Confirm','Store Mail Confirm',''),(14,'store/set_password','Store Set Password','Store 